import React, { useState } from 'react';

import { CountryCodeKey, CountryCodeSubField, DoubleRecord, Record } from './types';
import chroma from 'chroma-js';
import CountryCodes from './CountryCodes';
import { FitToChart, Scale } from './Scaling';

type CountryProps = {
    record:DoubleRecord
    fill:string 
    active:boolean
    setCountry: React.Dispatch<React.SetStateAction<CountryCodeKey>>
}

const Country = (props:CountryProps) => {
    let d = CountryPaths[props.record.ReportingEconomyCode];
    if (d ==="") {
        //console.log(`No path data for ${props.record.ReportingEconomyCode} `)
        return null;
    }
    const handleClick = (e: React.MouseEvent<SVGGElement, MouseEvent>) => {
        e.preventDefault();
        props.setCountry(props.record.ReportingEconomyCode);
    }

    return ( 
        <g onClick={e => handleClick(e)} className="Country">
            <path id={props.record.ReportingEconomyCode}
                data-id={props.record.ReportingEconomyCode}
                d={d}
                strokeWidth={props.active ? "5" : "1"}
                stroke={props.active ? "gray" : ""}
                fill={props.fill} fillRule="evenodd" /> 
        </g>
        );
}

type InfoProps = {
    active:boolean
    country?:string
    unit?:string 
    importValue?:number
    exportValue?:number
    offset?:{x:number, y:number}
}

const Info = (props:InfoProps) => {
    if (!props.active) return null;
    let {x,y} = props.offset? props.offset : {x:0,y:0};
    x = x > 1000 ? x-400 : x+50;
    y = y < 500 ? y-115 : y-5;
    return  (
    <g id={"countryInfo"}>
        <rect rx="5" fillOpacity=".6" fill="white" stroke="black" x={2 + x} y={2 + y} width="300" height="110"/>
    <text  x={5 + x } 
        y={5 +y}
        textAnchor="left" 
        fontSize="30"
        fontWeight="bold" 
        fill="black"
        textLength="290"    
        stroke="none"
        dominantBaseline="text-before-edge">{props.country}
    </text>
    <text  x={5 + x } 
        y={50 +y }
        textAnchor="left" 
        fontSize="20"
        stroke="none" 
        fill="black" 
        dominantBaseline="text-before-edge">{"Import: " + props.importValue + " " + props.unit} </text>
         <text  x={5 + x } 
        y={80 +y }
        textAnchor="left" 
        fontSize="20"
        stroke="none" 
        fill="black" 
        dominantBaseline="text-before-edge">{"Export: " + props.exportValue + " " + props.unit}  </text>
</g>)
}

type CountriesProps = {
    records:Array<DoubleRecord> 
    colorScale:chroma.Scale<chroma.Color>
    numericScale:Scale
    forwardRef: React.RefObject<SVGSVGElement>
    setCountry: React.Dispatch<React.SetStateAction<CountryCodeKey>>
}


const Countries = (props:CountriesProps) => {
    const irelevantCountries = CountryKeys.filter(key => 0 >  (props.records.findIndex(record => record.ReportingEconomyCode === key )))
    const [active, setActive] = useState<number>(-1);
    const [info, setInfo] = useState<InfoProps>({active:false})
    
    const handleHover = (e:React.MouseEvent<SVGGElement, MouseEvent>, idx?:number) => {
        let CTM = props.forwardRef.current?.getScreenCTM()?.inverse();
        if (idx && CTM) {
            let {e:x, f:y} = CTM.translate(e.clientX, e.clientY)
            let record = props.records[idx];
            let infoProps:InfoProps = {
                offset:{x:x,y:y},
                country:CountryCodes.Country[record.ReportingEconomyCode],
                unit:record.Unit,
                importValue:record.importValue,
                exportValue:record.exportValue,
                active:true
            }
            setInfo( () => {return {...infoProps}});
            setActive(idx)
        }
        else {
            setActive(-1)
            setInfo(() => {return {active:false}})
        }
        e.preventDefault();
    }
    return (
        <g>
        {irelevantCountries.map((key) => (
            <IrelevantCountry key={key} country={key}/>
        ))}
        {props.records.map((record, idx) => ( 
            <g key ={"country-group-"+idx} onMouseEnter={(e) => handleHover(e, idx)} onMouseLeave={(e) => handleHover(e)}>
                <Country key={record.ReportingEconomyCode}
                    setCountry={props.setCountry}
                    record={record}
                    fill={props.colorScale(1-FitToChart(record.exportValue - record.importValue, 1, props.numericScale)).name()} 
                    active={active === idx}/>
            </g>
        ))} <Info {...info}/>
        </g>
    )
}

const IrelevantCountry = (props:{country:CountryCodeKey}) => {
    let d = CountryPaths[props.country];
    return ( <path
        id={props.country}
        data-id={props.country}
        d={d}
        fill="white" fillRule="evenodd" stroke="gray"/>)
}


